defmodule NanoWeb.ProgramQuestionLive do
  use NanoWeb, :live_view

  def mount(_params, %{"room_id" => room_id}, socket) do
    if connected?(socket) do
      Phoenix.PubSub.subscribe(Nano.PubSub, "room:#{room_id}:questions")
    end

    {:ok, assign(socket, room_id: room_id, active_question: nil)}
  end

  def handle_info({:question_activated, question}, socket) do
    {:noreply, assign(socket, active_question: question)}
  end

  def handle_info({:question_deactivated, _question}, socket) do
    {:noreply, assign(socket, active_question: nil)}
  end

  def render(assigns) do
    ~H"""
    <div
      class="brown-normal rounded-2xl py-4 px-6 border-4 border-[var(--orange-normal)]"
      style="box-shadow: inset -10px -10px 10px rgba(0, 0, 0, .8);"
    >
      <%= unless @active_question do %>
        <div class="space-y-4">
          <h3 class="text-xl font-bold">{@active_question && @active_question.question}</h3>

          <div class="grid grid-cols-4 gap-4 px-10">
            <button phx-click="select_answer" phx-value-answer="1">
              <svg
                width="86"
                height="74"
                viewBox="0 0 86 74"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
                xmlns:xlink="http://www.w3.org/1999/xlink"
              >
                <g clip-path="url(#clip0_515_393)">
                  <rect width="88.064" height="75.7776" fill="url(#pattern0_515_393)" />
                </g>
                <defs>
                  <pattern
                    id="pattern0_515_393"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use xlink:href="#image0_515_393" transform="scale(0.00195312 0.0022779)" />
                  </pattern>
                  <clipPath id="clip0_515_393">
                    <rect width="86" height="74" fill="white" />
                  </clipPath>
                  <image
                    id="image0_515_393"
                    width="512"
                    height="439"
                    preserveAspectRatio="none"
                    xlink:href="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </button>

            <button phx-click="select_answer" phx-value-answer="2">
              <svg
                width="72"
                height="79"
                viewBox="0 0 72 79"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
                xmlns:xlink="http://www.w3.org/1999/xlink"
              >
                <rect width="69.9958" height="76.8" fill="url(#pattern0_515_394)" />
                <defs>
                  <pattern
                    id="pattern0_515_394"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use xlink:href="#image0_515_394" transform="scale(0.0021692 0.00195695)" />
                  </pattern>
                  <image
                    id="image0_515_394"
                    width="461"
                    height="511"
                    preserveAspectRatio="none"
                    xlink:href="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </button>

            <button phx-click="select_answer" phx-value-answer="3">
              <svg
                width="79"
                height="79"
                viewBox="0 0 79 79"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
                xmlns:xlink="http://www.w3.org/1999/xlink"
              >
                <rect width="76.8" height="76.8" fill="url(#pattern0_515_395)" />
                <defs>
                  <pattern
                    id="pattern0_515_395"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use xlink:href="#image0_515_395" transform="scale(0.00196078 0.00195695)" />
                  </pattern>
                  <image
                    id="image0_515_395"
                    width="510"
                    height="511"
                    preserveAspectRatio="none"
                    xlink:href="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </button>

            <button phx-click="select_answer" phx-value-answer="4">
              <svg
                width="68"
                height="68"
                viewBox="0 0 68 68"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
                xmlns:xlink="http://www.w3.org/1999/xlink"
              >
                <g clip-path="url(#clip0_515_396)">
                  <rect width="67.9337" height="67.9337" fill="url(#pattern0_515_396)" />
                </g>
                <defs>
                  <pattern
                    id="pattern0_515_396"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use xlink:href="#image0_515_396" transform="scale(0.0019685)" />
                  </pattern>
                  <clipPath id="clip0_515_396">
                    <rect width="68" height="68" fill="white" />
                  </clipPath>
                  <image
                    id="image0_515_396"
                    width="508"
                    height="508"
                    preserveAspectRatio="none"
                    xlink:href="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </button>
          </div>
        </div>
      <% else %>
        <p class="text-gray-500 text-center">No active question at the moment.</p>
      <% end %>
    </div>
    """
  end

  def handle_event("select_answer", %{"answer" => answer}, socket) do
    if socket.assigns.active_question do
      # Here you would typically send the answer to the server
      # and handle the response (e.g., show if it's correct)
      send(self(), {:answer_selected, socket.assigns.active_question.id, answer})
    end

    {:noreply, socket}
  end
end
